import React from "react";

export default function index() {
  return (
    <div className="container">
      <nav>
        <ul>
          <li>
            <a>Contact Me</a>
          </li>

          <li>
            <a>Projects</a>
          </li>

          <li>
            <a>Home</a>
          </li>
        </ul>
      </nav>
      <h1>Hey I am Olalekan</h1>
      <p> Aspiring Full Stack Developer</p>
      <style jsx>
        {`
          .container {
            text-align: center;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            width: 100%;
            height: 100vh;
          }
          p {
            font-size: 3rem;
            font-weight: 200;
            font-style: italic;
          }
          ul {
            list-style-type: none;
            margin-right: 2rem;
          }
          li {
            float: right;
  color: white;
  text-align: center;
  padding: 10px;
  text-decoration: none;
  font-size: 20px;
  line-height: 35px;
  border-radius: 4px;
  display: block;
  font-family: "Roboto", sans-
          }
          nav {
            overflow: hidden;
            background-color: red;
            position: fixed;
            top: 0;
            width: 100%;
            float: right;
            padding: 5px 5px;

          }
        `}
      </style>
      <style jsx global>{`
  body {
    background: lightblue};
  }
`}</style>
    </div>
  );
}
